import { Routes, Route } from 'react-router-dom';
import {Reg} from './Reg';

function App() {

  return (
    <>
     <Nav/> 
     {
     reg=="card"?<Cards setReg/>:<Reg/>
     }
    </>
  );
}

export default App;
